import React from 'react';
import './App.css';

function App() {
  return (
    <main className="App">
      <div className="Card">
            <div className="header">
                <picture>
                    <img src="./imgs/image-victor.jpg" alt="Victor" />
                </picture>
            </div>
        </div>
    </main>
  );
}

export default App;
